      <View style={styles.container}>
             <TouchableOpacity style={styles.button}>
          <Text style={styles.textButton}>Registrar</Text>
        </TouchableOpacity>
      </View>
    )
  }

  const styles = StyleSheet.create({
    container: {
        backgroundColor: '#fff',
    },

    textButton:{
     padding:20,
 
      fontSize:20,
      marginTop:20,
     marginBottom:10,
